import React, { useState } from "react";

const labels = {
  imagesDisplay: "Display Images",
  imagesGreyscale: "Greyscale Images",
};

const ProofRead = () => {
  const [state, setState] = useState({
    imagesDisplay: true,
    imagesGreyscale: false,
    imageSize: "full",
  });

  const negateStateValue = (stateIndex) => {
    setState((prevState) => ({
      ...prevState,
      [stateIndex]: !prevState[stateIndex],
    }));
  };

  const selectChanged = (e) => {
    setState((prevState) => ({
      ...prevState,
      imageSize: e.target.value,
    }));
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 p-6">
      <div className="bg-white shadow-lg rounded-lg p-6 w-full max-w-md">
        <h2 className="text-xl font-semibold text-gray-700 text-center mb-4">
          Print Configurations
        </h2>
        <form className="space-y-4">
          {["imagesDisplay", "imagesGreyscale"].map((item, index) => (
            <div key={index} className="flex items-center space-x-3">
              <input
                type="checkbox"
                id={item}
                className="h-5 w-5 text-blue-600 border-gray-300 rounded"
                onChange={() => negateStateValue(item)}
                checked={state[item]}
              />
              <label htmlFor={item} className="text-gray-700">
                {labels[item]}
              </label>
            </div>
          ))}

          <div>
            <label className="block text-gray-700 font-medium mb-1">
              Image Size
            </label>
            <select
              className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
              onChange={selectChanged}
              value={state.imageSize}
            >
              {["full", "small", "tiny"].map((item, index) => (
                <option key={index} value={item}>
                  {item}
                </option>
              ))}
            </select>
          </div>
        </form>
      </div>
    </div>
  );
};

export default ProofRead;
